import React from 'react';
import Expendelitem from './Expenselitem';
import "./ExpensesLis.css";
export default function ExpensesList(props) {
  let contentExpense =
   filterDateHandel.length === 0 ? 
    <p style={{color:"white"}}>Not Found Expense</p> : 
    filterDateHandel.map( expense =>   
    <Expendelitem 
     key= {expense.id}
     title={expense.title} 
     data={expense.data}
     amount={expense.amount} 
     />)
  return (
   <ul>
     props.items.map( expense =>   
     <Expendelitem 
       key= {expense.id}
       title={expense.title} 
       data={expense.data}
       amount={expense.amount} 
        />)

   </ul>
  )
}
